import React from 'react';
import Slider from "react-slick";

function Home() {
    const settings = {
        dots: true,
        infinite: true,
        speed: 500,
        slidesToShow: 1,
        fade: true,
        slidesToScroll: 1,
        autoplay: true,
        autoplaySpeed: 2000
    };
    return (
        <div class="slider">
            <Slider {...settings}>
            <div className="myslide fade slide-1">
                <div className="txt">
                    <h1>IMAGE 1</h1>
                    <p>Web Devoloper<br />Subscribe To My Channel For More Videos</p>
                </div>
            </div>

            </Slider>
        </div>
    );
}

export default Home;
